import React from 'react';

const navigationItem = ({ link, className, children, exact }) => {
  return (
    <li className={className}>
      <NavLink

        exact={exact}
        to={link}
      >
        {children}
      </NavLink>
    </li>
  );
}


export default navigationItem;
